  const { currentUser } = useAuth();
  return currentUser ? (
    <>
      <div className="d-flex align-items-center justify-content-center mt-5">
        <h1>Hello, {currentUser}!</h1>
      </div>
      <MDBBtn onClick={handleLogout}>Logout</MDBBtn>
      <MDBBtn onClick={handleLogout}>Logout</MDBBtn>
    </>
  ) : (
    <NotLoggedInComponent />
  );
};

